      <description>Princeton-by-the-Sea (sometimes, especially locally, called Princeton) is an unincorporated community on the coast of San Mateo County, California. The ZIP Code is 94019 and the community is inside area code 650. This area was inhabited by Ohlone tribes in pre-Columbian times. Because of the special microhabitat of the adjacent Pillar Point Harbor, there are numerous [...]&lt;img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=stunningplaces.wordpress.com&amp;amp;blog=4925416&amp;amp;post=367&amp;amp;subd=stunningplaces&amp;amp;ref=&amp;amp;feed=1" width="1" height="1" /&gt;&lt;br&gt;&lt;a type="audio/mpeg" href="http://podcasts.odiogo.com/get_mp3.mp3?f=/stunningplacess-weblog/Stunningplacess_Weblog-Princeton_CA.mp3"&gt;Click here to play&lt;/a&gt;&lt;br&gt;</description>
      <content:encoded><![CDATA[<p><a title="CLICK HERE" href="http://snurl.com/4rwwn"><strong>Princeton-by-the-Sea</strong> (sometimes, especially locally, called Princeton) is an unincorporated community on the coast of San Mateo County, California. The ZIP Code is 94019 and the community is inside area code 650.</p>
<p>This area was inhabited by Ohlone tribes in pre-Columbian times. Because of the special microhabitat of the adjacent Pillar Point Harbor, there are numerous pelagic birds that visit the local area. The area has a boating cachet for harbor activities and has been a tourist destination since the early 1900s with the establishment of the Princeton Inn Hotel. As of 2000, the population of the community is 297.</p>
<p>Besides the harbor, with its piers and docks, Princeton has a number of shops, restaurants, and accommodations. The community is near State Route 1, the Cabrillo Highway, just north of Half Moon Bay and south of Moss Beach.</p>
<p>The annual surfing competition Mavericks actually takes place in Princeton, although it is usually attributed to neighboring Half Moon Bay.</p>
<p><a title="CLICK HERE" href="http://snurl.com/4rwwn"><img class="alignnone size-full wp-image-368" title="princeton-ca" src="http://stunningplaces.files.wordpress.com/2008/10/princeton-ca.jpg?w=375&#038;h=500" alt="" width="375" height="500" /></a></p>
