      <description>Arbuckle is a census-designated place (CDP) in Colusa County, California, United States. The population was 2,332 at the 2000 census. The town entrance sign on I-5 only says 864 people, but it&amp;#8217;s very old and hasn&amp;#8217;t been updated. The town of Arbuckle is situated in the southerly portion of Colusa County, approximately 20 miles (32 [...]&lt;img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=stunningplaces.wordpress.com&amp;amp;blog=4925416&amp;amp;post=352&amp;amp;subd=stunningplaces&amp;amp;ref=&amp;amp;feed=1" width="1" height="1" /&gt;&lt;br&gt;&lt;a type="audio/mpeg" href="http://podcasts.odiogo.com/get_mp3.mp3?f=/stunningplacess-weblog/Stunningplacess_Weblog-Arbuckle_CA.mp3"&gt;Click here to play&lt;/a&gt;&lt;br&gt;</description>
      <content:encoded><![CDATA[<p><a title="CLICK HERE" href="http://snurl.com/4rwwn"><strong>Arbuckle</strong> is a census-designated place (CDP) in Colusa County, California, United States. The population was 2,332 at the 2000 census. The town entrance sign on I-5 only says 864 people, but it&#8217;s very old and hasn&#8217;t been updated. The town of Arbuckle is situated in the southerly portion of Colusa County, approximately 20 miles (32 km) southwest of the City of Colusa, the County seat. Arbuckle is characterized by single-family residences, multiple-family units, some mobile homes, and commercial activities. The land surrounding Arbuckle is mostly agriculture including cultivated annual crops, and both active and unmaintained orchards (primarily almond). Regional access is provided by the north south running Interstate Highway 5.</a></p>
